/**
 * Thrown in case the request could not be parsed and transformed to CQN.
 * @extends {external:Error}
 * @alias module:errors.RequestCannotBeParsed
 */
class RequestCannotBeParsed extends Error {
  /**
   * Create a RequestCannotBeParsed.
   */
  constructor (rootCauseError) {
    super('Request could not be parsed and transformed to CQN')
    this.name = this.constructor.name
    this.rootCause = rootCauseError
    Error.captureStackTrace(this, this.constructor)
  }
}

module.exports = RequestCannotBeParsed
